import React from 'react';
import { Form, InputGroup } from 'react-bootstrap';

const SearchBar = ({ searchQuery, setSearchQuery }) => {
  return (
    <div style={{}}>
      <InputGroup className="w-50 ms-0 position-relative">
      <Form.Control
        type="text"
        placeholder="Strains, brands, products..."
        className="form-control rounded-pill me-2"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
        style={{ paddingLeft: '2.2rem', fontSize: '12px' }}
      />
      <span
        className="position-absolute top-50 start-0 translate-middle-y ps-3 text-secondary"
        style={{ fontSize: '.95rem' }}
      >
        <i className="bi bi-search"></i>
      </span>
    </InputGroup>
    </div>
  );
};

export default SearchBar;
